                            errorMask: errorMask,
                            copyMask?.GetSubCrystal((int)Effect_FieldIndex.ScriptEffect));
                    }
                    else
                    {
                        item.ScriptEffect = default;
                    }
                }
                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
            DeepCopyInCustom(
                item: item,
                rhs: rhs,
                errorMask: errorMask,
                copyMask: copyMask,
                deepCopy: deepCopy);
        }
        
